import React, { Component } from 'react'
import { Steps, Button, message } from 'antd';
import 'antd/dist/antd.css'

const { Step } = Steps;
export default class NewFront extends  React.Component {
    constructor(props) {
        super(props);
        this.state = {
            current: 0,
        };
    }


  onChange = current => {
    console.log('onChange:', current);
    this.setState({ current });
  };

    next() {
        const current = this.state.current + 1;
        this.setState({ current });
    }

    prev() {
        const current = this.state.current - 1;
        this.setState({ current });
    }

    render() {
        const { current } = this.state;
        return (
            <div>
        <Steps current={current} onChange={this.onChange}>
          <Step title="Step 1" description="This is a description." />
          <Step title="Step 2" description="This is a description." />
          <Step title="Step 3" description="This is a description." />
        </Steps>
        <Steps

          current={current}
          onChange={this.onChange}
          className="site-navigation-steps"
        >
          <Step status="process" title="Step 1" />
          <Step status="process" title="Step 2" />
          <Step status="process" title="Step 3" />
          <Step status="process" title="Step 4" />
          <Step status="process" title="Step 5" />
          <Step status="process" title="Step 6" />
          <Step status="process" title="Step 7" />
        </Steps>
            </div>
        )
    }
}
